import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { title: "baba", amount: 23.22, date: new Date(2021, 10, 4) },
    { title: "baba2", amount: 28.22, date: new Date(2021, 10, 4) },
    { title: "baba3", amount: 23.22, date: new Date(2021, 10, 4) },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <p>Hello there</p>
      <ExpenseItem title={expenses[0].title}></ExpenseItem>
    </div>
  );
}

export default App;
